description:
Conversation téléphonique avec le président. Il a été discuté: 
- E-mail et demandes de Monsieur F. Tissot, CA;
- Séance du 30.06.2020 concernant les règlements de gestion et de placement; GH sera présent au Brassus à cette séance;
- Rapport annexe aux comptes discuté, Sec. Lending, point du droit de vote et comme ce point a été formulé au rapport annexe aux comptes. Le président propose une rencontre au Brassus durant l'été; 
- GH informe sur le rapport Risk & Compliance. Le président étudie ce rapport et me viendra plus tard. Gh/16.06.2020
